import { ScrollView, View } from 'react-native';
import { Appbar, Card, Text, ProgressBar, Button, withTheme } from 'react-native-paper';

function PreTestScreen({ navigation, theme }) {

	return (
		<>
			<Appbar.Header>
				<Appbar.BackAction onPress={() => navigation.goBack()} />
				<Appbar.Content title="Akademi Bank Sampah" />
			</Appbar.Header>

			<ScrollView>
				<Card style={{ margin: 10 }} onPress={() => navigation.navigate('KelasScreen')}>
					<Card.Content>
						<Text variant="titleMedium">Kerjakan Soal</Text>
					</Card.Content>
					<Card.Actions>
						<Button mode="text">Lihat Detil</Button>
					</Card.Actions>
				</Card>
			</ScrollView>

			<Button icon="plus" mode="contained" onPress={() => navigation.navigate('CariKelasScreen')} style={{ margin: 10 }}>Gabung Kelas</Button>
		</>
	);
}

export default withTheme(PreTestScreen);
